  \"2014-04-24T15:00:38.264631\",\n\t\"name\": \"instruction-manual-and-frog-survey-protocols-for-region-1-national-wildlife-refuges-east-s\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This manual is intended to assist biologists
  wishing to conduct surveys for frogs and toads.  The document includes detailed
  information on how to conduct surveys, what habitat to concentrate on, how to determine
  the best time of year to conduct surveys, and appropriate weather conditions for
  surveys.  Information is also provided on species identification, safe capture,
  handling, and transport of specimens, how to take voucher photographs, raising tadpoles,
  collection and preservation of specimens, and disinfection of equipment.    Written
  specifically for National Wildlife Refuges in the Eastern Oregon, Eastern Washington,
  and Idaho, the document includes a description of frog and toad species to expect
  in the project area, recommended life stage to target for inventory surveys, and
  breeding chronology and approximate timing within the project zone.  Species specific
  survey methods are provided as well, and include species description and identification
  tips, appropriate habitat and timing for survey.  Photographs of different life
  stages and reference habitats are provided as well.\",\n\t\"license_title\": \"License
